import puppeteer from 'puppeteer';


export default defineEventHandler(async (event) => {
try{

  const browser = await puppeteer.launch();
  const page = await browser.newPage();
  // Example HTML content
  const htmlContent = `
    <!DOCTYPE html>
<html>
<head>
  <style>
    @page {
      size: A4;
      margin: 20mm;
      @bottom-center {
        content: "Page " counter(page) " of " counter(pages);
        font-size: 10px;
      }
    }
    body {
      font-family: Arial, sans-serif;
      color: #265630;
      margin: 0;
    }
    .content {
      margin: 20mm;
      color: #265630;
    }

  </style>
</head>
<body>
  <div class="relative flex items-center justify-center min-h-screen bg-gray-100 overflow-hidden">
        <!-- Background Image -->
        <div absolute inset-0 flex  opacity-10>
            <img src="data:image/png;base64," alt="Background Image"
                class="w-full h-full object-contain" />
        </div>

        <!-- Message Container -->
        <div class="body relative z-10 text-center px-4">
            <h1 class="text-4xl font-extrabold text-green-800 mb-4">Oops! Looks like the page you are looking for does not exist.</h1>
            <p class="text-green-800 text-xl font-medium mb-2">
                Please check the URL or return to the homepage.
            </p>
            <NuxtLink to="AdminDashboard" class="content mt-4 inline-block px-6 py-3 bg-green-700 text-white rounded-md hover:bg-green-800">
                Go to Homepage
            </NuxtLink>
        </div>
    </div>
</body>
</html>

  `;
  await page.setContent(htmlContent);

  const pdfBuffer = await page.pdf({ format: 'A4' });
  await browser.close();

  // Set response headers
  setHeader(event, 'Content-Type', 'application/pdf');
  setHeader(event, 'Content-Disposition', 'inline; filename=generated.pdf');

  return pdfBuffer;


}catch(err){
    console.log(err);
    return err;
}

});
